YUI.add('srpl-business-templates', function(Y){
// DO NOT EDIT THIS FILE
// this should be automatically generated by using the .*.html files in templates
Y.namespace('srpl.Business');
Y.srpl.Business.templates = {
    description:Y.template('<% if (b.get(\'description\')) { %>\n<div class="srpl-container">\n    <h3><%= Y.srpl.util.stringTruncator(b.get(\'description\'),Y.srpl.config(\'business.descriptionLimit\')) %></h3>\n</div>\n<% }%>'),
		details:Y.template('<div class="srpl-container srpl-detail-container">\n    <div class="srpl-container-body">\n        <% if (b.get(\'hours\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Hours</div>\n            <div class="yui3-u-3-4 srpl-day-hours-container">\n                <%\n                Y.each(b.get(\'hours\').days,function(d,i){\n                %>\n                <p class="srpl-day-hours"><%= d.desc %></p>\n                <%\n                });\n                %>\n                <button class="srpl-see-all noborder">See all hours</button>\n            </div>\n        </div>\n        <% } if (b.get(\'categories\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Category</div>\n            <div class="yui3-u-3-4">\n            <%\n                Y.each(b.get(\'categories\'),function(c,i){%>\n                <a target="<%= Y.srpl.config(\'linking.target\') %>" href="<%= c.url %>" title="<%= c.name %>"><%= c.name %></a><%= (i === b.get(\'categories\').length-1 || i === 0) ? \'\' : \', \' %>\n            <%});%>\n            </div>\n        </div>\n        <% } if (b.get(\'payment\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Payment</div>\n            <div class="yui3-u-3-4"><%= b.get(\'payment\') %></div>\n        </div>\n        <% } if (b.get(\'cuisine\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Cuisine</div>\n            <div class="yui3-u-3-4"><%= b.get(\'cuisine\') %></div>\n        </div>\n        <% } if (b.get(\'ambiance\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Ambiance</div>\n            <div class="yui3-u-3-4"><%= b.get(\'ambiance\') %></div>\n        </div>\n        <% } if (b.get(\'feature\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Feature</div>\n            <div class="yui3-u-3-4"><%= b.get(\'feature\') %></div>\n        </div>\n        <% } if (b.get(\'attire\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Attire</div>\n            <div class="yui3-u-3-4"><%= b.get(\'attire\') %></div>\n        </div>\n        <% } if (b.get(\'price\')) { %>\n        <div class="yui3-g srpl-container-sub">\n            <div class="yui3-u-1-4">Price</div>\n            <div class="yui3-u-3-4"><%= b.get(\'price\') %></div>\n        </div>\n        <% } %>\n        <ul class="srpl-actions clearfix">\n            <li class="first-child srpl-more-details" style="display:none">\n                <a href="<%= b.getBusinessUrl() %>" class="f-left" title="View More Details">View More Details</a>\n            </li>\n            <li class="last-child f-right">\n                <a href="<%= b.getBusinessUrl() %>" class="f-right" title="Suggest an edit">Suggest an edit</a>\n            <li>\n        </ul>\n    </div>\n</div>'),
		full:Y.template('<div class="srpl-header yui3-g">\n    <div class="srpl-hero-container yui3-u-17-24 column1">\n        <%= Y.srpl.Hero.templates.base({b:b,r:r,h:h}) %>\n    </div>\n    <div class="srpl-map yui3-u-7-24 column2"></div>\n</div>\n<div class="srpl-body yui3-g">\n    <div class="yui3-u-17-24 column1">\n        <%= Y.srpl.Business.templates.description({b:b}) %>\n        <%= Y.srpl.Business.templates.gallery({b:b}) %>\n        <div class="srpl-container srpl-foursquare" style="display:none;"></div>\n        <div class="srpl-container srpl-yelp-reviews" style="display:none;"></div>\n        <div class="srpl-container srpl-yahoo-reviews" style="display:none;"></div>\n    </div>\n    <div class="yui3-u-7-24 column2">\n        <%= Y.srpl.Business.templates.details({b:b}) %>\n    </div>\n</div>'),
		gallery:Y.template('<% \n    var photos = b.getThumbnailGalleryPhotos();\n    if (photos.length > 0) { %>\n    <div class="srpl-container srpl-gallery">\n        <div class="srpl-container-body">\n            <ul class="clearfix">\n            <%\n            photos = photos.slice(0,Y.srpl.config(\'business.galleryCount\'));\n            Y.each(photos, function(p,i){ %>\n                <li class="<%=(i===0) ? \'first-child\' : \'\'%> <%=(i===(photos.length-1)) ? \'last-child\' : \'\'%> srpl-gallery-thumbnails">\n                    <img src="<%= p %>" alt="<%= b.displayValue() %>"/>\n                </li>\n            <%}); %>\n            </ul>\n            <ul class="srpl-actions clearfix">\n                <li class="first-child">\n                    <a href="<%=b.getBusinessUrl()%>" title="Add Photos">Add Photos</a>\n                </li>\n            </ul>\n        </div>\n    </div>\n<% }%>')
};
}, '@VERSION@',{
    // [bug 5892107] no need to require assets     
    requires:['srpl-template']
});